import React from 'react'
import * as FaIcons from "react-icons/fa"
import * as AiIcons from "react-icons/ai"


export const SidebarData = [
    {
        title: 'Home',
        path: '/',
        cName: 'nav-text'

    }, 

    {
        title: 'About',
        path: '/about',
        icon: <FaIcons.FaCartPlus />,
        cName: 'nav-text'

    }, 

    {
        title: 'Contact Me',
        path: '/contact-me',
        icon: <FaIcons.FaCartPlus />,
        cName: 'nav-text'

    }, 
]
